import "../../styles/landing-main.scss";

function CatalogItem({img, title, price}) {
  return (
    <div className="catalog-item">
      <img className="catalog-item__img"></img>
      <span className="catalog-item__title">{}</span>
      <span className="catalog-item__price">3390 грн.</span>
      <div className="catalog-item__buttons">
        <a href="#" className="catalog-item__bout">
          Про товар
        </a>
        <a href="#" className="catalog-item__basket">
          В кошик
        </a>
      </div>
    </div>
  );
}

export default function CatalogMain() {
  return (
    <div className="catalog-main">
      <div className="catalog-main__header">
        <div className="catalog-main__title">Каталог</div>
        <div className="catalog-main__more">Дивитися більше</div>
      </div>
      <div className="catalog-main__items">
        <CatalogItem></CatalogItem>
      </div>
    </div>
  );
}
